import './Tags.css';
import { useState } from 'react';

function Tags(props) {

    return(
        <div className="filterTagsContainer">
            {
                tagArray.map((tag) => {
                    return <span
                                    id="tag"
                                    >
                                        {tag.key}
                                </span>
                })
            }
          </div>
    )
}

export default Tags;
